import React, { useEffect, useState } from 'react';
import { TextField, Container, Paper, Button, makeStyles } from '@mui/material';

const useStyles = makeStyles((theme) => ({
    root: {
      '& > *': {
        margin: theme.spacing(1),
       
      },
    },
  }));
  
  export default function Security() {
      const paperStyle={padding:'50px 20px', width:600,margin:"20px auto"}
      const[nume,setLastName]=useState('')
      const[prenume,setFirstName]=useState('')
      const[email,setEmail]=useState('')
      const[parola,setPassword]=useState('')
       const classes = useStyles();
  
    return (
  
      <Container>
          <Paper elevation={3} style={paperStyle}>
              <h1 style={{color:"blue"}}><u>Security</u></h1>
  
      <form className={classes.root} noValidate autoComplete="off">
      
        <TextField id="outlined-basic" label="Nume" variant="outlined" fullWidth 
        value={nume}
        onChange={(e)=>setLastName(e.target.value)}
        />
        <TextField id="outlined-basic" label="Prenume" variant="outlined" fullWidth
        value={prenume}
        onChange={(e)=>setFirstName(e.target.value)}
        />
        <TextField id="outlined-basic" label="Email" variant="outlined" fullWidth
        value={prenume}
        onChange={(e)=>setEmail(e.target.value)}
        />
        <TextField id="outlined-basic" label="Password" variant="outlined" fullWidth
        value={parola}
        onChange={(e)=>setPassword(e.target.value)}
        />
        <Button variant="contained" color="secondary" onClick={handleClick}>
    Register
  </Button>
      </form>
      </Paper>
      </Container>
    );
  }
